insert into producto value(1, 'vendedor1', 'Gabinete Yeyian Blade 2101 con Ventana LED Rojo, Midi-Tower, ATX/Micro-ATX, USB 2.0/3.1, sin Fuente, Negro', '¡COMIENZA EL JUEGO! El gabinete Blade 2101 está pensado para competir en el mercado de los gabinetes de entrada su principal atractivo es el precio, este Gabinete te permite un buen manejo de cables, flujo de aire y espacio para tarjetas de video de tamaño grande.', 819, 0, 10, 'https://ebarrotes.s3.us-west-1.amazonaws.com/assets/gabinete1.webp');
