insert into producto value(3, 'vendedor1', 'Monitor Gamer Game Factor MG-600 LED 24.5'', Full HD, Widescreen, 144Hz, HDMI, Negro', 'Máximo detalle aún en las situaciones mas movidas. Gracias a su refresco de 144Hz, siempre podrás captar hasta el mas mínimo detalle. No importa si estás en una batalla de shooters, jugando tu MOBA favorito o a punto de ganar la última carrera, el monitor MG600 siempre te dará la ventaja.', 3789, 0, 10, 'https://ebarrotes.s3.us-west-1.amazonaws.com/assets/monitor2.webp');
insert into producto value(4, 'vendedor1', 'Gabinete NZXT H510 Elite con Ventana RGB, Midi-Tower, ATX/EATX/Micro ATX/Mini-ATX, USB 3.0, sin Fuente, Blanco', 'The H510 Elite features a removable radiator mounting bracket, simple-to-use SSD trays, and a patented cable management system for a smarter, easier build experience. The new Smart Device 2 includes two HUE 2 RGB lighting channels, and three fan channels that support 0dB modes for voltage-regulated or PWM fans', 3359, 0, 10, 'https://ebarrotes.s3.us-west-1.amazonaws.com/assets/gabinete2.webp');
