insert into producto value(7, 'vendedor1', 'SSD XPG Spectrix S40G, 256GB, PCI Express 3.0, M.2', 'Con altas velocidades de lectura y escritura, iluminación RGB personalizable y una gran cantidad de características que mejoran el rendimiento, la unidad XPG SPECTRIX S40G, no deja lugar a dudas para aquellos que buscan un rendimiento espectacular y una fiabilidad excepcional.', 909, 0, 10, 'https://ebarrotes.s3.us-west-1.amazonaws.com/assets/ssd1.webp');
insert into producto value(8, 'vendedor1', 'SSD XPG GAMMIX S5 NVMe, 256GB, PCI Express 3.0, M.2', 'Boot, load, and transfer faster with the XPG GAMMIX S5 PCIe Gen3x4 M.2 2280 solid state drive (SSD). With support for NVMe 1.3 and equipped with 3D NAND Flash, it offers up to 4 times faster performance than SATA SSDs and up to 1TB of capacity. What’s more, the GAMMIX S5 sports excellent heat dissipation capability with a built-in heatsink that can lower temperatures by up to 10°C.', 779, 0, 10, 'https://ebarrotes.s3.us-west-1.amazonaws.com/assets/ssd2.jpg');
